;; **
;;; $$---Joel---$$
;;; 
;;; **list plot**
;;; 
;;; $$----$$
;;; 
;;; 
;;; 
;; **

;; **
;;; The score function itself is easy to implement.
;; **

;; @@
(defn score
  [data ex]
  (let [f (functionalise ex)]
    (* -1 (apply + (map #(Math/abs (- (f (first %)) (second %))) data)))))
